	/**
	 * 给你k种面值的硬币，面值分别为c1, c2 ... ck，每种硬币的数量无限，再给一个总金额amount，问你最少需要几枚硬币凑出这个金额，如果不可能凑出，算法返回 -1 
	 * @return
	 */
	public static int getMinCoin(int n){
		int[] f=new int[n+1];
		for (int i = 0; i < f.length; i++) {
			f[i]=n+1;
		}
		f[0]=0;
		for (int i = 0; i < f.length;  i++) {
			for (int j = 0; j <coins.length; j++) {
				if(i-coins[j]<0){
					continue;
				}
				f[i]=Math.min(f[i], f[i-coins[j]]+1);
			}
		}
		for (int i = 0; i < f.length; i++) {
			System.out.println(i+"="+f[i]);
		}
		return f[n]==n+1?-1:f[n];
	}
	
	public static boolean isMatch3(String s, String p) {
        int m = s.length();
        int n = p.length();

        boolean[][] f = new boolean[m + 1][n + 1];
        f[0][0] = true;
        for (int i = 0; i <= m; ++i) {
            for (int j = 1; j <= n; ++j) {
                if (p.charAt(j - 1) == '*') {
                    f[i][j] = f[i][j - 2];
                    if (matches(s, p, i, j - 1)) {
                        f[i][j] = f[i][j] || f[i - 1][j];
                    }
                }
                else {
                    if (matches(s, p, i, j)) {
                        f[i][j] = f[i - 1][j - 1];
                    }
                }
            }
        }
        return f[m][n];
    }

    public static boolean matches(String s, String p, int i, int j) {
        if (i == 0) {
            return false;
        }
        if (p.charAt(j - 1) == '.') {
            return true;
        }
        return s.charAt(i - 1) == p.charAt(j - 1);
    }
	
	public static boolean isMatch2(String s, String p) {
		int sLen = s.length(), pLen = p.length();
		boolean[][] memory = new boolean[sLen + 1][pLen + 1];
		memory[0][0] = true;
		for (int i = 0; i <= sLen; i++) {
			for (int j = 1; j <= pLen; j++) {
				if (p.charAt(j - 1) == '*') {
					memory[i][j] = 
							memory[i][j - 2]
							|| (i > 0&& (s.charAt(i - 1) == p.charAt(j - 2) || p.charAt(j - 2) == '.') && memory[i - 1][j]);
				} else {
					memory[i][j] = 
							i > 0
							&& (s.charAt(i - 1) == p.charAt(j - 1) || p.charAt(j - 1) == '.')
							&& memory[i - 1][j - 1];
				}
			}
		}
		return memory[sLen][pLen];

	}
	
