	/**
	 * 9. 回文数
	 * @param x
	 * @return
	 */
	public static boolean isPalindrome(int x) {
		if (x < 0) {
			return false;
		}
		int y=0;
		int temp=x;
		while(temp>0){
			int ge=temp%10;
			y=y*10+ge;
			temp=temp/10;
		}
		return x==y;
    }
	
	/**
	 * 8. 字符串转换整数 (atoi)
	 * 如果第一个非空字符为正或者负号时，则将该符号与之后面尽可能多的连续数字字符组合起来，形成一个有符号整数。
	  假如第一个非空字符是数字，则直接将其与之后连续的数字字符组合起来，形成一个整数。
	 该字符串在有效的整数部分之后也可能会存在多余的字符，那么这些字符可以被忽略，它们对函数不应该造成影响。
	 * 
	 * @param s
	 * @return
	 */
	public static int myAtoi(String s) {
		if (s == null) {
			return 0;
		}
		char[] cs = s.toCharArray();
		StringBuffer sb = new StringBuffer();
		boolean isFirst = true;
		boolean isPositive = true;
		for (int i = 0; i < cs.length; i++) {
			if (isFirst && ' ' == cs[i]) {
				// System.out.println("kongge");
				continue;
			}
			if (isFirst && ('+' == cs[i] || '-' == cs[i])) {
				isFirst = false;
				if ('-' == cs[i]) {
					isPositive = false;
				}
				continue;
			}
			if (cs[i] >= '0' && cs[i] <= '9') {
				isFirst = false;
				sb.append(cs[i]);
			} else {
				break;
			}
		}
		System.out.println("" + sb.toString());
		if(sb.length()==0){
			return 0;
		}
		int value = 0;
		try {
			value = Integer.parseInt(sb.toString());
		} catch (Exception e) {
			if (isPositive) {
				return Integer.MAX_VALUE;
			} else {
				return Integer.MIN_VALUE;
			}
		}
		if (!isPositive) {
			value = -value;
		}
		return value;
    }
	
	/**
	 * 7. 整数反转
	 * 给出一个 32 位的有符号整数，你需要将这个整数中每位上的数字进行反转。
		示例 1:
		输入: 123
		输出: 321
 		示例 2:
		输入: -123
		输出: -321
		示例 3:
		输入: 120
		输出: 21
	 * @param x
	 * @return
	 */
	public static int reverse(int x) {
		String s = String.valueOf(x);
		if (x < 0) {
			s = s.substring(1, s.length());
		}
		// System.out.println("s="+s);
		char[] cs = s.toCharArray();
		int length = cs.length;
		for (int i = 0; i < length / 2; i++) {
			char temp = cs[i];
			cs[i] = cs[length - i - 1];
			cs[length - i - 1] = temp;
		}
		int b = 0;
		try {
			b =Integer.valueOf(new String(cs));
		} catch (Exception e) {

		}
		if (x < 0) {
			b = -b;
		}
		return b;
	}
	
	/**
	 * Z 字形变换
	 * 将一个给定字符串根据给定的行数，以从上往下、从左到右进行 Z 字形排列。
	比如输入字符串为 "LEETCODEISHIRING" 行数为 3 时，排列如下：
	L   C   I   R
	E T O E S I I G
	E   D   H   N
	之后，你的输出需要从左往右逐行读取，产生出一个新的字符串，比如："LCIRETOESIIGEDHN"。
	 * @param s
	 * @param numRows
	 * @return
	 */
	public static String convert(String s, int numRows) {
		if (s == null || s.length() == 0) {
			return "";
		}
		if(numRows<2){
			return s;
		}
		int group=numRows*2-2;
		int count=s.length()/group;
		int index=0;
		char[] cs=s.toCharArray();
		StringBuilder sb=new StringBuilder();
		for (int i = 0; i < numRows; i++) {
			for (int j = 0; j <= count; j++) {
				index=group*j + i;
				//System.out.println(""+index);
				if(index<cs.length){
					sb.append(cs[index]);
				}
				if(i>0&&i<numRows-1){
					index=group*j +group-i;
					//System.out.println(""+index);
					if(index<cs.length){
						sb.append(cs[index]);
					}
				}
			}

		}
		return sb.toString();
	}
	
	public static String longestPalindrome2(String s) {
		if (s == null || s.length() == 0) {
			return "";
		}
		int[] range=new int[2];
		char[] cs=s.toCharArray();
		for (int i = 0; i < cs.length; i++) {
			getLongest(cs,i,range);
		}
		return s.substring(range[0], range[1]+1);
	}
	
	/**
	 * 寻找以low为中心的回文字符串
	 * @param cs
	 * @param low
	 * @param range
	 */
	public static void getLongest(char[] cs, int low, int[] range) {
		int high = low;
		while(high < cs.length - 1&&cs[high+1]==cs[low]){
			high++;
		}
		while (low > 0 && high < cs.length - 1 && cs[low - 1] == cs[high + 1]) {
			low--;
			high++;
		}
		if(high-low>range[1]-range[0]){
			range[0]=low;
			range[1]=high;
		}
		System.out.println("low="+low+" high="+high);
	}
		
	
	
	
	public static String longestPalindrome1(String s) {
		if (s == null || s.length() == 0) {
			return "";
		}
		// 保存起始位置，测试了用数组似乎能比全局变量稍快一点
		int[] range = new int[2];
		char[] str = s.toCharArray();
		for (int i = 0; i < s.length(); i++) {
			// 把回文看成中间的部分全是同一字符，左右部分相对称
			// 找到下一个与当前字符不同的字符
			i = findLongest(str, i, range);
		}
		return s.substring(range[0], range[1] + 1);
	}
	static int count;
	//"babad"
	public static int findLongest(char[] str, int low, int[] range) {
		count++;
		// 查找中间部分
		int high = low;
		System.out.println(count+" low="+low+" high="+high);
		while (high < str.length - 1 && str[high + 1] == str[low]) {
			high++;
		}
		
		// 定位中间部分的最后一个字符
		int ans = high;
		System.out.println(count+" low="+low+" high="+high);
		// 从中间向左右扩散
		while (low > 0 && high < str.length - 1
				&& str[low - 1] == str[high + 1]) {
			low--;
			high++;
		}
		System.out.println(count+" low="+low+" high="+high);
		// 记录最大长度
		if (high - low > range[1] - range[0]) {
			range[0] = low;
			range[1] = high;
		}
		return ans;
	}
	
	/**
	 * 5. 最长回文子串,回文子串即从左往右输出和从右往左输出结果是一样的字符串
	 * 给定一个字符串 s，找到 s 中最长的回文子串。你可以假设 s 的最大长度为 1000。
	 * 输入: "babad" 输出: "bab"注意: "aba" 也是一个有效答案
	 * @param s
	 * @return
	 */
	public static String longestPalindrome(String s) {
		if(s==null||"".equals(s)){
			return "";
		}
		if(s.length()==1){
			return s;
		}
		System.out.println("length="+s.length());
		String max="";
		int length=s.length();
		for (int count=2; count <=length; count++) {
			for (int i = 0; i < length-count+1; i++) {
				String temp=s.substring(i,count+i);
				//System.out.println("temp="+temp);
				if(isPaliStr(temp)){
					max=temp;
					//System.out.println("max="+max);
					break;
				}
			}
		}
		if("".equals(max)){
			max=s.substring(0,1);
		}
		return max;
    }
	
