	/**
	 *  4.给定两个大小为 m 和 n 的正序（从小到大）数组 nums1 和 nums2。请你找出并返回这两个正序数组的中位数。
	 *  输入：nums1 =[1,2], nums2 = [3,4] 
	 *  输出：2.50000 解释：合并数组 = [1,2,3,4] ，中位数 (2 + 3) / 2 =2.5
	 * 
	 * @param nums1
	 * @param nums2
	 * @return
	 */
	public static double findMedianSortedArrays(int[] nums1, int[] nums2) {
		int[] totals = new int[nums1.length + nums2.length];
		int length = totals.length;
		int n1 = 0;
		int n2 = 0;
		if(nums1.length==0){
			totals=nums2;
		}else if(nums2.length==0){
			totals=nums1;
		}else{
			for (int i = 0; i < length; i++) {
				if (nums1[n1] < nums2[n2]) {
					totals[i] = nums1[n1];
					n1++;
					if (n1 == nums1.length && n2 < nums2.length) {
						i++;
						System.arraycopy(nums2, n2, totals, i, length - i);
						break;
					}
				} else {
					totals[i] = nums2[n2];
					n2++;
					if (n2 == nums2.length && n1 < nums1.length) {
						i++;
						System.arraycopy(nums1, n1, totals, i, length - i);
						break;
					}
				}
			}
			//System.out.println("" + Arrays.toString(totals));
		}
		
		if (length == 0) {
			return 0f;
		}
		if (length % 2 == 1) {
			return totals[length / 2 ];
		} else {
			return (float) (totals[length / 2 - 1] + totals[length / 2]) / 2;
		}
	}

	public static int lengthOfLongestSubstring2(String s) {
		// 记录字符上一次出现的位置
		int[] last = new int[128];
		for (int i = 0; i < 128; i++) {
			last[i] = -1;
		}
		int n = s.length();
		int res = 0;
		int start = 0; // 窗口开始位置
		for (int i = 0; i < n; i++) {
			int index = s.charAt(i);
			start = Math.max(start, last[index] + 1);
			res = Math.max(res, i - start + 1);
			last[index] = i;
			// System.out.println("index="+index+" start="+start+" res="+res);
		}

		return res;
	}

	/**
	 * 3.给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度。 输入: "abcabcbb" 输出: 3
	 * 解释:因为无重复字符的最长子串是"abc"，所以其长度为 3。
	 * 
	 * @param s
	 * @return
	 */
	public static int lengthOfLongestSubstring1(String s) {
		if (s == null || "".equals(s)) {
			return 0;
		}
		int max = 0;
		int k = 0, j = 0;
		char[] cs = s.toCharArray();
		int length = cs.length;
		char[] last = new char[256];
		for (int i = 0; i < length; i++) {
			if (contains(last, cs[i], k)) {
				i = j++;
				k = 0;
			} else {
				last[k++] = cs[i];
				if (k > max) {
					max = k;
				}
			}
		}
		System.out.println("k=" + k + " j=" + j);
		return max;
	}

	public static boolean contains(char[] cs, char c, int max) {
		for (int i = 0; i < max; i++) {
			if (cs[i] == c) {
				return true;
			}
		}
		return false;
	}

	/**
	 * 给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度。 输入: "abcabcbb" 输出: 3
	 * 解释:因为无重复字符的最长子串是"abc"，所以其长度为 3。
	 * 
	 * @param s
	 * @return
	 */
	public static int lengthOfLongestSubstring(String s) {
		if (s == null || "".equals(s)) {
			return 0;
		}
		int max = 0;
		int length = s.length();
		System.out.println("length=" + length);
		ArrayList<Character> list = new ArrayList<>();
		for (int i = 0; i < length; i++) {
			list.clear();
			// System.out.println("i=" + i);
			for (int j = i; j < length; j++) {
				char temp = s.charAt(j);
				if (list.contains(temp)) {
					list.clear();
					break;
				} else {
					list.add(temp);
					if (max < list.size()) {
						max = list.size();
						if (max > 255) {
							return max;
						}
					}
				}
			}
		}
		return max;
	}

	/**
	 * 2,输入：(2 -> 4 -> 3) + (5 -> 6 -> 4) 输出：7 -> 0 -> 8 原因：342 + 465 = 807
	 * 
	 * @param l1
	 * @param l2
	 * @return
	 */
	public static ListNode addTwoNumbers(ListNode l1, ListNode l2) {
		ListNode head = null;
		ListNode last = null;
		int value = 0;
		while (l1 != null || l2 != null || value >= 10) {
			int v1 = (l1 == null ? 0 : l1.val);
			int v2 = (l2 == null ? 0 : l2.val);
			value = v1 + v2 + value / 10;
			ListNode temp = new ListNode(value % 10);
			if (last == null) {
				head = temp;
				last = temp;
			} else {
				last.next = temp;
				last = temp;
			}
			l1 = (l1 == null ? null : l1.next);
			l2 = (l2 == null ? null : l2.next);
			System.out.println(last);
		}
		System.out.println(head);
		return head;
	}

